import React from "react";
import {Component} from "react";
import top50 from "../images/top50 global.jpg"
import top50selected from "../images/top50selected.jpg"
import jsondata from "./data.json";
import MusicPlayer from "./songsaudiofiles"


class Homepage extends React.Component {
    constructor(){
        super()
        this.state = {
          audio:"",
        }
    }

    Playsong = (e) => {
     console.log(e)
    }
 

      render(){
          return (
            <section>
            <div>
            <h1>Homepage</h1>
            <img src={top50} style={{"height":"70vh","width":"100%", "objectFit":"cover"}} />
            </div>
            <div>
            <img src={top50} style={{"height":"auto","width":"200px", "objectFit":"cover"}} /> 
            <ul>
            {
            jsondata.map((data, i)=>{
              return (<li key={i} onClick={this.Playsong}>{data.Name}</li>)
            })
            }
            </ul>
            <MusicPlayer/>
            {this.state.audio}
            </div>
            </section>
        )
      }
}

export default Homepage
